import React from 'react';
import { useParams } from "react-router-dom";
import { Row, Col } from 'react-bootstrap';

const ProductDetails = () => {
    const { productid } = useParams();
    console.log(productid,typeof(productid))

    return (
        <Row className="justify-content-md-center" xs={3}>
            <Col className="mt-4">
                <div>
                    {productid === '0' ? (
                        <>
                        <div class="row">
                        <div class="column">
                            <img src="https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcTXXdUWe93xn5b9s2sQ_ZmEOI7IpsAkmEfRPpy42PRmgU1OkSUY" />
                        </div>
                        <div class="column">
                            <img src="https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcS0dufKtc6NPLbXeNGC-4sPFks6NMombYIfXvfHMEPATZ8Dtg3X" />
                        </div>
                        <div class="column">
                            <img src="https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcR4V7zqpbqpKlnYAjEMA5DrB5eNd68oYbP4kS8A5wYSIp4p1CGU" />
                        </div>
                        </div>
                        </>
                    ) : (
                        <h1>Other Product</h1>
                    )}
                </div>
            </Col>
        </Row>
    );
}

export default ProductDetails;
